export const ButtonHomePage = ({ setHomePage }) => {
  return (
    <button
      className="btnPrimary"
      onClick={() => {
        setHomePage(false);
      }}
    >
      Iniciar
    </button>
  );
};

export const ButtonHome = ({ setHomePage }) => {
  return (
    <button
      className="btnHome"
      onClick={() => {
        setHomePage(true);
      }}
    >
      Inicio
    </button>
  );
};

export const ButtonsFilter = ({ setFilter, type }) => {
  return id === "Todos" ? (
    <button
      className="btns"
      onClick={() => {
        setFilter("");
      }}
    >
      {id}
    </button>
  ) : id === "Entradas" ? (
    <button
      className="btns"
      onClick={() => {
        setFilter("entrada");
      }}
    >
      {id}
    </button>
  ) : (
    <button
      className="btns"
      onClick={() => {
        setFilter("saida");
      }}
    >
      {id}
    </button>
  );
};
